INSERT INTO `qna` VALUES (4,'broker',15,'하이투자증권','',10,'kk','문읭{ㅖ요','tetet',1430134932,'2015-04-22 02:34:55'),(5,'broker',15,'하이투자증권','',11,'이민호테스트1','궁금해요. 하이투자증권','대답했어요 하이투자증권',1429900921,'2015-04-24 18:32:34'),(6,'broker',17,'하나대투증권','',11,'이민호테스트1','궁금해요 하나대투증권','대답했어요 하나대투증권',1429900910,'2015-04-24 18:32:47'),(8,'strategy',33,'이민호','샘플투자전략길이테스트길이테스트길이테스트길이테스트길이테스트길이테스트길이테스트',10,'kk','무늬누민','',0,'2015-04-25 08:51:05'),(9,'broker',15,'하이투자증권','',5,'이민호','브로커 문의 테스트','',0,'2015-05-01 13:32:44'),(10,'strategy',33,'이민호','샘플투자전략길이테스트길이테스트길이테스트길이테스트길이테스트길이테스트길이테스트',5,'이민호','궁금해요 전략','',0,'2015-05-06 03:25:02'),(11,'strategy',75,'태사랑','IO 옵션합성',23,'','궁금합니다. ','',0,'2015-06-21 10:31:42'),(12,'broker',15,'하이투자증권','',23,'','브로커에게 문의합니다.','',0,'2015-06-21 10:32:07'),(13,'strategy',111,'제이앤제이','J & J 합성전략 2',67,'박공주','일반 투자자입니다. \r\n어떻게 투자할 수 있는지 피드백 바랍니다.','',0,'2015-08-07 09:23:43'),(14,'strategy',103,'안전우상향','주식 10년우상향 ',84,'이 호연','문의 합니다.\r\n\r\n기업선정과 수익실현은 어떠한 방법으로 하는지요?\r\n\r\n수익이 나면 수수료는 어떻게 되는지요?\r\n\r\n최소 가입금액 궁금합니다','',0,'2015-08-19 09:01:23'),(15,'broker',27,'대신증권','',99,'','대신증권 API(싸이보스플러스)를 활용하기 위한 교육을 받아보고 싶습니다. 관련된 교육이 있나요? 있으면 커리큐럼을 받아보고 싶습니다.','',0,'2015-09-14 08:27:01'),(16,'strategy',103,'안전우상향','주식 10년우상향 ',117,'김문주','안녕하세요, \r\n혹시 최소위탁금액 및 가동 형태를 여쭤봐도 될까요?\r\n그리고 주식/ETF 매매 원칙에 대해 조금만 더 설명이 있으면 좋겠습니다.  \r\n감사합니다.','',0,'2015-10-20 14:38:24'),(17,'strategy',103,'안전우상향','주식 10년우상향 ',130,'김현석','하나대투 계좌를 위탁해야 하나요?\r\n최소금액은 얼마인지요?\r\n\r\n수수료는 어떻게 되는지요?\r\n\r\n감사합니다.','',0,'2015-11-05 14:42:52'),(18,'broker',18,'교보증권','',135,'도경아빠','어느지점 누구신가요?? ㅎㅎ 목동지점 옥성주입니다 ','',0,'2015-11-13 01:18:26'),(19,'strategy',76,'제이든','리치테크 FuturesDay Pyramiding',126,'ㅇㅇ','안녕하세요.\r\n\r\n다름이 아니라 시스메틱 트레이더 자료를 보면서 위탁 운용이 가능한지 한번 여쭤보고자 문의를 드렸습니다.\r\n\r\n혹시 가능하다면 투자와 관련하여 반드시 알아야 하는 약관 혹은 절차가 있는지 알려주시면 감사하겠습니다.','',0,'2015-12-10 04:56:40'),(20,'broker',17,'하나대투증권','',126,'ㅇㅇ','안녕하세요.\r\n\r\n시스템 트레이딩을 접하면서 소액으로 위탁투자를 해보고자 문의드립니다.\r\n\r\n괌심있는 전략은 하나대투의 \"주식 10년우상향 \" 입니다. \r\n\r\n\r\n\r\n혹여나 답장을 주신다면, heuristic.son@gmail.com 로 연락을 주시면 감사하겠습니다.','이메일로 답변드렸습니다.',1450758268,'2015-12-14 05:43:30'),(21,'broker',15,'하이투자증권','',126,'ㅇㅇ','안녕하세요.\r\n\r\n투자를 위탁해보고자 문의드립니다.\r\n\r\n제가 관심있는 전략은 하이투자의 \"리치테크 FuturesDay Pyramiding \"\r\n\r\n\"설현사랑 FuturesDay \" 이 두 가지 입니다.\r\n\r\n\r\n답변 주실 때는 번거로우시겠지만 heuristic.son@gmail.com 으로 연락주시면 감사하겠습니다.\r\n\r\n그럼 안녕히계세요.','답변 보내드렸습니다.',1450758113,'2015-12-14 05:49:31');
